import React, { useState, useEffect } from 'react';
import { Button, Form, Input } from 'antd';
import { Line } from 'react-chartjs-2';
import 'chart.js/auto';
import './HallDetail.css';

interface DailyData {
  day: number;
  feedConsumption: number;
  waterConsumption: number;
  averageWeight: number;
  mortality: number;
}

interface RossStandardData {
  day: number;
  weightKg: number;
  feedConsumptionGram: number;
  waterConsumptionLiter: number;
  mortalityCount: number;
}

const HallDetail: React.FC = () => {
  const [dailyData, setDailyData] = useState<DailyData[]>([]);
  const [rossStandardData, setRossStandardData] = useState<RossStandardData[]>([]);
  const [currentDay, setCurrentDay] = useState(1);

  useEffect(() => {
    // Initialize daily data and standard data.
    setDailyData([
      { day: 1, feedConsumption: 1.2, waterConsumption: 2.5, averageWeight: 0.5, mortality: 2 },
      { day: 2, feedConsumption: 1.5, waterConsumption: 3.0, averageWeight: 0.7, mortality: 1 },
      // Add more days here
    ]);
    setRossStandardData([
      { day: 1, weightKg: 0.5, feedConsumptionGram: 1200, waterConsumptionLiter: 2.5, mortalityCount: 2 },
      { day: 2, weightKg: 0.7, feedConsumptionGram: 1500, waterConsumptionLiter: 3.0, mortalityCount: 1 },
      // Add more days here
    ]);
  }, []);

  const handleDailySubmit = (values: any) => {
    // Update daily data for the current day
    setDailyData((prevData) =>
      prevData.map((data) =>
        data.day === currentDay ? { ...data, ...values } : data
      )
    );
    console.log('Updated Daily Data:', dailyData);
  };

  const goToPreviousDay = () => setCurrentDay((prevDay) => Math.max(prevDay - 1, 1));
  const goToNextDay = () => setCurrentDay((prevDay) => Math.min(prevDay + 1, 56));

  const dailyDataForCurrentDay = dailyData.find((data) => data.day === currentDay) || {};
  const standardDataForCurrentDay = rossStandardData.find((data) => data.day === currentDay) || {};

  const chartData = {
    labels: dailyData.map((data) => `Day ${data.day}`),
    datasets: [
      {
        label: 'Feed Consumption (kg)',
        data: dailyData.map((data) => data.feedConsumption),
        borderColor: 'rgba(75,192,192,1)',
        backgroundColor: 'rgba(75,192,192,0.2)',
      },
      {
        label: 'Water Consumption (liters)',
        data: dailyData.map((data) => data.waterConsumption),
        borderColor: 'rgba(54,162,235,1)',
        backgroundColor: 'rgba(54,162,235,0.2)',
      },
      {
        label: 'Mortality',
        data: dailyData.map((data) => data.mortality),
        borderColor: 'rgba(255,99,132,1)',
        backgroundColor: 'rgba(255,99,132,0.2)',
      },
    ],
  };

  return (
    <div className="hall-detail-container">
      <h2>Hall Details for Day {currentDay}</h2>
      <div className="day-navigation">
        <Button onClick={goToPreviousDay} disabled={currentDay === 1}>
          Previous Day
        </Button>
        <span>Day {currentDay}</span>
        <Button onClick={goToNextDay} disabled={currentDay === 56}>
          Next Day
        </Button>
      </div>

      <div className="chart-container">
        <Line data={chartData} />
      </div>

      <Form
        onFinish={handleDailySubmit}
        initialValues={dailyDataForCurrentDay}
        layout="vertical"
      >
        <Form.Item label="Feed Consumption (kg)" name="feedConsumption" rules={[{ required: true }]}>
          <Input type="number" />
        </Form.Item>
        <Form.Item label="Water Consumption (liters)" name="waterConsumption" rules={[{ required: true }]}>
          <Input type="number" />
        </Form.Item>
        <Form.Item label="Average Weight (kg)" name="averageWeight" rules={[{ required: true }]}>
          <Input type="number" />
        </Form.Item>
        <Form.Item label="Mortality" name="mortality" rules={[{ required: true }]}>
          <Input type="number" />
        </Form.Item>
        <Form.Item>
          <Button type="primary" htmlType="submit">
            Submit
          </Button>
        </Form.Item>
      </Form>

      <div className="daily-summary">
        <h3>Standard Data for Current Day</h3>
        <p><strong>Weight (kg):</strong> {standardDataForCurrentDay.weightKg || 'N/A'}</p>
        <p><strong>Feed Consumption (g):</strong> {standardDataForCurrentDay.feedConsumptionGram || 'N/A'}</p>
        <p><strong>Water Consumption (liters):</strong> {standardDataForCurrentDay.waterConsumptionLiter || 'N/A'}</p>
        <p><strong>Mortality:</strong> {standardDataForCurrentDay.mortalityCount || 'N/A'}</p>
      </div>
    </div>
  );
};

export default HallDetail;
